You can use if statements to run code if a certain condition holds. If the expression evaluates to True , some statements are carried out.Otherwise they aren't carried out. An if statement looks like this: if expression: statements Python uses indentation , (white spaces at the beginning of a line) to delimit blocks of code. Depending on the program's logic, indentation can be mandatory. As you can see, the statements in the if should be indented. Here is an example of if statement: if 10 > 5: print("10 is greater than 5") print("The program ended") The expression determines whether 10 is greater than 5. Since it is, the indented statement runs, and "10 is greater than 5" is output. Then, the unindented statement, which is not a part of the if statement, is run, and "Program ended" is displayed. Notice the colon at the end of the expression in the if statement. To perform more complex checks, if statements can be nested, one inside the other. This means that the inner if statement is the statement part of the outer one. This is one way to see whether multiple conditions are satisfied. For example: num = 12
if num > 5: print("Bigger than 5") if num <= 47: print("between 5 and 47") Indentation is used to define the level of nesting. else Statements The if statement allows you to check a condition and run some statements, if the condition is True . The else statement can be used to run some statements when the condition of the if statement is False . As with if statements, the code inside the block should be indented. x = 4
if x == 5: print("Yes")
else: print("No") Notice the colon after the else keyword. Every if condition block can have only one else statement. In order to make multiple checks, you can chain if and else statements. For example, the following program checks and outputs the num variable's value as text: num = 3
if num == 1: print("One")
else: if num == 2: print("Two") else: if num == 3: print("Three") Indentation determines which if/else statements the code blocks belong to. elif Statements Multiple if/else statements make the code long and not very readable. The elif (short for else if) statement is a shortcut to use when chaining if and else statements, making the code shorter. The same example from the previous part can be rewritten using elif statements: num = 3:
if num == 1: print("One")
elif num == 2: print("Two")
elif num == 3: print("Three")
else: print("None are true") As you can see in the example above, a series of if elif statements can have a final else block, which is called if none of the if or elif expressions is True . The elif statement is equivalent to an else/if statement. It is used to make the code shorter, more readable, and avoid indentation increase.

